import { Button, TextField, Dialog, DialogActions, DialogContent, 
    DialogTitle, DialogContentText } from '@material-ui/core';

import React from 'react';

type Props = {
    openCreateAccount: boolean;
    handleCloseCreateAccount: () => void;
}

const CreateAccount: React.FC<Props> = ({openCreateAccount, handleCloseCreateAccount}: Props) => {
    return (
        <Dialog open={openCreateAccount} onClose={handleCloseCreateAccount} fullWidth>
            <DialogTitle>Welcome Back!</DialogTitle>
            <DialogContent>
                <DialogContentText>
                    Sign in to create threads, comment and more...
                </DialogContentText>
                <TextField
                    autoFocus
                    type='text'
                    margin="normal"
                    label="Username"
                    fullWidth
                    variant="outlined"
                />
                <TextField
                    type='password'
                    margin="normal"
                    label="Password"
                    fullWidth
                    variant="outlined"
                />
                <br style={{height: '50px'}}/>
                <DialogContentText>
                    Dont have an account? Create one to do much more!
                </DialogContentText>
            </DialogContent>
            <DialogActions>
                <Button onClick={handleCloseCreateAccount}>Cancel</Button>
                <Button onClick={handleCloseCreateAccount}>Sign In</Button>
            </DialogActions>
        </Dialog>
    );
};

export default CreateAccount;
